import Layout from '../comps/FormLayout'

export default function Name() {
  return (
	<Layout>
	    <form>
		  <label>
		    Name:
		    <input type="text" name="name" />
		  </label>
		  <input type="submit" value="Submit" class="submit"/>
		</form>
		<style jsx>{`
        .submit:{display:block; }
      `}</style>
	</Layout>
  );
 return (
 	<Layout />
 );
}
